import React from 'react'
import { Link } from 'react-router-dom'

export default function categories() {
    const categories = [
        {
            name:'all',
            text:'all'
        },
        {
            name:'electronics',
            text:'electronics'
        },
        {
            name:'jewelery',
            text:'jewelery'
        },
        {
            name:'men',
            text:'men'
        },
        {
            name:'men"s clothing ',
            text:'men"s clothing '
        },
    ]
  return (
    <div>
        {categories.map((c,idx) =>(
            <Link
            key={idx}
            to={c.name === 'all' ? '/shop' : `/shop/${c.name}`
        }>
            {c.text}

            </Link>
        ))}
    </div>
  )
}
